! function() {
	$(document).bind("click", function(h) {
		if ($(h.target).closest("#search-choice").length == 0) {
			$("#search-engin-list").hide()
		} else {
			$("#search-engin-list").toggle()
		}
	});
	$("#search-engin-list .engin").click(function() {
		var h = $(this).attr("engin");
		g(h);
		e("search_engin", h)
	});


}();


